import React from 'react';
import { NavLink } from 'react-router-dom';
import Nav from 'react-bootstrap/Nav';

const MenuExamine = () => {
  return (
    <div>
      <Nav variant="underline" justify defaultActiveKey="/" style={{ backgroundColor: '#FFB703' }}>
        <Nav.Item>
          <Nav.Link as={NavLink} to="/Profile_examine" style={{ color: 'white' }}> Accueil </Nav.Link>
        </Nav.Item>
        <Nav.Item>
          <Nav.Link as={NavLink} to="/Mes_résultats_d'examen" style={{ color: 'white' }}>Résultats d'examens</Nav.Link>
        </Nav.Item>
      </Nav>
    </div>
  );
}

export default MenuExamine;
